import React, { Component } from 'react';

class Header extends Component {
	render() {
		return (
			<div className="header">
				<div className="row-nm">
					<nav>
						<div style={{paddingTop: '1em'}}>
									<h1><span className="swash">N</span>e<span className="ss-v">v</span>erla<span className="ss-n">n</span>d</h1>
						</div>
						<button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-labels="Neverland navigation">
							<span class="navbar-toggler-icon"></span>
						</button>
						<div class="collapse navbar-collapse" id="navbarSupportedContent">
								<a href="/our-story">Our Story</a>
								<a href="#plants">Plants</a>
								<button style={{marginTop: '4px'}} onClick={this.onClickWaitlist} className="neverland-button"> JOIN THE WAITLIST </button><br/>
						</div>
					</nav>
				</div>
			</div>);
	}
}

export default Header;
